class QuizGame {
    constructor(data) {
        this.data = data;
        this.currentIndex = 0;
        this.progressElement = document.getElementById('progress');
        this.mainElement = document.getElementById('main');
        this.modalElement = document.getElementById('modal');
        this.badgeModalElement = document.getElementById('badge-modal');
        this.modalCloseButton = document.getElementById('modal-close');
        this.timerElement = null;
        this.timer = null;
        this.currentCountdown = 0;
        this.earnedBadges = [];

        this.modalCloseButton.addEventListener('click', () => this.hideModal());
        this.hideModal( )
        this.init();
    }

    init() {
        
        this.loadQuestion();
    }

    loadQuestion() {
        const currentQuestion = this.data[this.currentIndex];

        this.mainElement.innerHTML = `
            <div class="text-center">
                <div id="timer" class="text-xl font-bold mb-2">${currentQuestion.countdown}</div>
                <div class="text-xl font-bold mb-2">${currentQuestion.title()}</div>
                <div class="text-2xl mb-4">${currentQuestion.question()}</div>
                ${currentQuestion.choices().map(choice => 
                    `<button class="choice-btn bg-blue-500 text-white px-4 py-2 m-2 rounded">${choice}</button>`
                ).join('')}
            </div>
        `;

        this.timerElement = document.getElementById('timer');
        this.currentCountdown = currentQuestion.countdown;
        this.startTimer();

        const choiceButtons = document.querySelectorAll('.choice-btn');
        choiceButtons.forEach(button => {
            button.addEventListener('click', (event) => this.handleChoice(event.target.textContent));
        });
    }

    startTimer() {
        this.timer = setInterval(() => {
            this.currentCountdown--;
            this.timerElement.textContent = this.currentCountdown;
            if (this.currentCountdown <= 0) {
                clearInterval(this.timer);
                this.showResult(false);
            }
        }, 1000);
    }

    handleChoice(choice) {
        clearInterval(this.timer);
        const currentQuestion = this.data[this.currentIndex];
        const isCorrect = choice === currentQuestion.answer();
        this.showResult(isCorrect);
    }

    showResult(isCorrect) {
        const currentQuestion = this.data[this.currentIndex];
        this.mainElement.innerHTML = `
            <div class="text-center">
                <div class="text-2xl mb-4 ${isCorrect ? 'text-green-500' : 'text-red-500'}">
                    ${isCorrect ? 'Correct!' : `Wrong! The correct answer is ${currentQuestion.answer()}`}
                </div>
            </div>
        `;
        if (isCorrect && currentQuestion.badge) {
            this.earnedBadges.push(currentQuestion.badge());
            this.showBadge(currentQuestion.badge());
        } else {
            setTimeout(() => this.nextQuestion(), 5000);
        }
    }


    showBadge(badgeSVG) {
        this.badgeModalElement.innerHTML = `
            <div class="text-2xl mb-4">You have earned a new badge!</div><div class="p-4 center flex items-center w-fit h-fit">
            ${badgeSVG}
            </div>
        `;
        this.modalElement.style.display = 'flex';
    }

    hideModal() {
        this.modalElement.style.display = 'none';
        this.nextQuestion();
    }

    nextQuestion() {
        this.currentIndex++;
        this.updateProgress();
        if (this.currentIndex < this.data.length) {
            this.loadQuestion();
        } else {
            this.mainElement.innerHTML = '<div class="text-center text-2xl">Quiz Completed!</div>';
        }
    }

    updateProgress() {
        this.progressElement.innerHTML = this.earnedBadges.join('');
    }
}

document.addEventListener('DOMContentLoaded', () => {
    new QuizGame(gameData);
});
